const MarkForm = ({classes}) =>
{
    const TravelToMarks = () =>
    {
        window.location.href = "http://localhost:3000/marks"
    }

    return (
        <div className={classes.form}>
            <button className={classes.buttonInForm} onClick={TravelToMarks}>Отметки</button>
        </div>
    )
}

export default MarkForm;
